INSERT INTO `config_info`
VALUES (594, 'link-admin', 'hairoutech-link',
        '#nacos服务发现服务器地址+端口号\nspring.cloud.nacos.discovery.server-addr=nova-nacos:8848\n#nacos登陆用户名\nspring.cloud.nacos.discovery.username=nacos\n#nacos登陆用户名\nspring.cloud.nacos.discovery.password=nacos\n#nacos服务注册分组\nspring.cloud.nacos.discovery.group=HAIQ\n#nacos服务注册命名空间\nspring.cloud.nacos.discovery.namespace=nova_prod\n\n#数据库类型\nspring.jpa.database=mysql\n#是否打印 sql ,不打印，log4jdbc打印sql\nspring.jpa.show-sql=false\n# 是否自动创建 table\nspring.jpa.generate-ddl=false\n#数据库存储引擎类型\nspring.jpa.database-platform=org.hibernate.dialect.MySQL57InnoDBDialect\n#启动项目时对数据库进行的操作\nspring.jpa.hibernate.ddl-auto=none\n#格式化输出sql语句\nspring.jpa.properties.hibernate.format_sql=true\n#是否在sql中输出注释信息\nspring.jpa.properties.hibernate.use_sql_comments=true\n#    hibernate:\n#This is the default for MySQL, no change to the database structure.\n#      none\n# update - Hibernate changes the database according to the given Entity structures.\n# create - Creates the database every time, but don’t drop it when close.\n# create-drop - Creates the database then drops it when the SessionFactory closes.\n# ddl-auto: update\n# 命名策略，会将Java代码中的驼峰命名法映射到数据库中会变成下划线法\nspring.jpa.properties.hibernate.physical_naming_strategy=org.springframework.boot.orm.jpa.hibernate.SpringPhysicalNamingStrategy\n#数据库url\nspring.datasource.url=jdbc:mysql://nova-mysql:3306/hairoutech_link?useSSL=false&serverTimezone=Asia/Shanghai&useUnicode=true&characterEncoding=utf8&allowPublicKeyRetrieval=true\n#数据库连接用户名\nspring.datasource.username=root\n#数据库连接密码\nspring.datasource.password=root\n\n#kafka服务器地址+端口号\nspring.kafka.bootstrap-servers=nova-kafka:9092\n#link-admin产生调用日志发送到kafka的消息topic\nspring.kafka.topic.invoke.log=GW_INVOKE_LOG_TOPIC_TEST\n#kafka消费端分组ID\nspring.kafka.consumer.group-id=consumer-link-admin-test\n#kafka消费消息offset策略\nspring.kafka.consumer.auto-offset-reset=earliest\n#kafka消费端key值序列化方式\nspring.kafka.consumer.key-deserializer=org.apache.kafka.common.serialization.StringDeserializer\n#kafka消费端value值序列化方式\nspring.kafka.consumer.value-deserializer=org.apache.kafka.common.serialization.StringDeserializer\n\n#kafka服务方分组ID\nspring.kafka.producer.group-id=producer-link-admin-test\n#kafka服务方key序列化方式\nspring.kafka.producer.key-serializer=org.apache.kafka.common.serialization.StringSerializer\n#kafka服务方value序列化方式\nspring.kafka.producer.value-serializer=org.apache.kafka.common.serialization.StringSerializer\n#kafka消息投递重试次数\nspring.kafka.producer.retries=3\n\n#调用日志保留数量\ninvoke.log.retainNumber=100000\n#调用日志清理任务定时指定cron表达式（凌晨3点触发，表达式后面的空格不要去掉）\ninvoke.log.clean.scheduler.cron=0 0 3 * * ? \n#invoke.log.clean.scheduler.cron=0,10,20,30,40,50 * * * * ? \n#日志清理定时任务名\nspring.quartz.scheduler-name=adminSchedule\n#定时任务的数据持久化方式\nspring.quartz.job-store-type=memory\n#定时任务自动启动\nspring.quartz.auto-startup=true\n#定时任务启动延迟\nspring.quartz.startup-delay=10s\n#是否等待定时任务执行完毕后才关闭容器\nspring.quartz.wait-for-jobs-to-complete-on-shutdown=true\n#新的定时任务覆盖旧的任务\nspring.quartz.overwrite-existing-jobs=false\n#定时任务线程数\nspring.quartz.properties.org.quartz.threadPool.threadCount=1\n#定时任务线程优先级\nspring.quartz.properties.org.quartz.threadPool.threadPriority=5\n#定时任务使用线程池类型\nspring.quartz.properties.org.quartz.threadPool.class=org.quartz.simpl.SimpleThreadPool\n\n#dubbo配置\ndubbo.application.name=link-admin\n#dubbo向外暴露地址\ndubbo.registry.address=N/A\n\n#i18n服务地址\nhairou-i18n.client.host=http://nova-haiq-i18n\n#本应用在i18n服务中的标识\nhairou-i18n.client.app-code=hairoutech-link\n\n#设置http header大小，保证大token能顺利传递\nserver.max-http-header-size=1024000',
        '9ce3e7e54b237f9a60b1e51e1a26789c', '2021-09-15 20:18:06', '2021-12-10 01:20:49', NULL, '172.17.0.1', '',
        'nova_prod', '', '', '', 'properties', '');
INSERT INTO `config_info`
VALUES (595, 'link-app', 'hairoutech-link',
        '#nacos服务发现服务器地址+端口号\nspring.cloud.nacos.discovery.server-addr=nova-nacos:8848\n#nacos登陆用户名\nspring.cloud.nacos.discovery.username=nacos\n#nacos登陆密码\nspring.cloud.nacos.discovery.password=nacos\n#nacos服务注册分组\nspring.cloud.nacos.discovery.group=HAIQ\n#nacos服务注册命名空间\nspring.cloud.nacos.discovery.namespace=nova_prod\n\n#kafka服务器地址+端口号\nspring.kafka.bootstrap-servers=nova-kafka:9092\n#link-app产生调用日志发送到kafka的消息topic\nspring.kafka.topic.invoke.log=GW_INVOKE_LOG_TOPIC_TEST\n\n#kafka消费端分组ID\nspring.kafka.consumer.group-id=consumer-link-app-test\n#kafka消费消息offset策略\nspring.kafka.consumer.auto-offset-reset=earliest\n#kafka消费端key值序列化方式\nspring.kafka.consumer.key-deserializer=org.apache.kafka.common.serialization.StringDeserializer\n#kafka消费端value值序列化方式\nspring.kafka.consumer.value-deserializer=org.apache.kafka.common.serialization.StringDeserializer\n\n#kafka服务方分组ID\nspring.kafka.producer.group-id=producer-link-app-test\n#kafka服务方key序列化方式\nspring.kafka.producer.key-serializer=org.apache.kafka.common.serialization.StringSerializer\n#kafka服务方value序列化方式\nspring.kafka.producer.value-serializer=org.apache.kafka.common.serialization.StringSerializer\n#kafka消息投递重试次数\nspring.kafka.producer.retries=3\n\n#dubbo配置\ndubbo.application.name=link-app\n#dubbo向外暴露地址\ndubbo.registry.address=N/A\n#dubbo服务协议\ndubbo.protocol.name=dubbo\n#dubbo服务内部端口号\ndubbo.protocol.port=20880\n#dubbo服务所在包名\ndubbo.scan.base-packages=com.hairoutech\n#i18n\n#i18n服务地址\nhairou-i18n.client.host=http://nova-haiq-i18n\n#本应用在i18n服务中的标识\nhairou-i18n.client.app-code=hairoutech-link\n\n#是否启用sentinel进行限流\nsentinel.perform.flow.limit=false\n\n# 插件的配置\n# 插件运行模式. dev: 开发环境, prod: 生产环境\nplugin.runMode=prod\n# 是否启用插件\nplugin.enable=true\n# 插件存放的目录\nplugin.pluginPath=/persistence/plugin/plugin\n#plugin.pluginPath=plugins/plugins/plugins\n#plugin.pluginPath=d:/code/hairoutech-link/hairoutech-link/plugins/plugins/plugins\n# 生产环境下, 插件文件的路径. 只在生产环境下生效\nplugin.pluginConfigFilePath=/persistence/plugin/config\n# 插件rest接口前缀\nplugin.pluginRestPathPrefix=/api/plugins/\n# 在卸载插件后, 备份插件的目录\nplugin.backupPath=/persistence/plugin/backup\n# 上传的插件所存储的临时目录\nplugin.uploadTempPath=/persistence/plugin/temp\n# 禁用的插件id, 禁用后系统不会启动该插件. 为Set集合. 配置案例如下:\n# disablePluginIds:\n#   - disable-id1\n#   - disable-id2\n#plugin.disablePluginIds=\n#插件中心的地址，用于反馈插件状态，便于监控\nplugin.storeHost=http://plugin.hairoutech.com\n#本项目在插件中心的标识，空代表不启用监控\nplugin.projectName=',
        '3f06ceff6076a31c32504770ea034108', '2021-09-15 20:18:06', '2021-12-10 01:14:23', NULL, '172.17.0.1', '',
        'nova_prod', '', '', '', 'properties', '');
INSERT INTO `config_info`
VALUES (597, 'hairoutech-user', 'hairoutech-user',
        '#nacos服务发现服务器地址+端口号\nspring.cloud.nacos.discovery.server-addr=nova-nacos:8848\n#nacos登陆用户名\nspring.cloud.nacos.discovery.username=nacos\n#nacos登陆密码\nspring.cloud.nacos.discovery.password=nacos\n#nacos服务注册分组\nspring.cloud.nacos.discovery.group=HAIQ\n#nacos服务注册命名空间\nspring.cloud.nacos.discovery.namespace=nova_prod\n\n# mybatis-plus 配置\n#DO类的路径\nmybatis-plus.typeAliasesPackage=com.hairoutech.user.repository.databases.entity\n#xml文件的路径\nmybatis-plus.mapperLocations=classpath*:/mapper/*.xml,classpath*:/mapper/business/*.xml\n#启用下划线转驼峰\nmybatis-plus.configuration.mapUnderscoreToCamelCase=true\n#控制台输出日志\nmybatis-plus.configuration.log-impl=org.apache.ibatis.logging.stdout.StdOutImpl\n\n#spring文件上传大小限制\nspring.servlet.multipart.max-file-size=1024MB\n#spring请求数据大小限制\nspring.servlet.multipart.max-request-size=1024MB\n#数据源类型\nspring.datasource.type=com.alibaba.druid.pool.DruidDataSource\n#数据库连接驱动类\nspring.datasource.driver-class-name=com.mysql.cj.jdbc.Driver\n#数据库url\nspring.datasource.url=jdbc:mysql://nova-mysql:3306/hairoutech_user?useUnicode=true&characterEncoding=utf8&useSSL=false&serverTimezone=UTC&allowPublicKeyRetrieval=true\n#数据库登陆用户名\nspring.datasource.username=root\n#数据库密码\nspring.datasource.password=root\n\n# druid 数据库连接池配置\n#连接池初始大小\nspring.datasource.druid.initial-size=5\n#连接池最大限制\nspring.datasource.druid.max-active=100\n#连接池最小空闲连接数\nspring.datasource.druid.min-idle=1\n#连接池最长等待时间(毫秒)\nspring.datasource.druid.max-wait=60000\n\n# swagger 接口配置, 详细见: https://doc.xiaominfo.com/knife4j/documentation/enhance.html\n# 是否启用\nknife4j.enable=true\n# 是否启用debug\nknife4j.setting.enableDebug=true\n\n# 系统核心配置\n# 超级管理员编码\nsystem.superRoleCode=super_admin\n# 超级管理员id\nsystem.superAdminId=1\n# 是否启用swagger\nsystem.swaggerEnable=true\n# jwt 签名key\nsystem.jwtSigningKey=defaultSigningKey\n# 不需要授权的接口地址匹配\n#system.noAuthPathPatterns=/api/user/test\n\n# web界面配置\nweb.webLocation=classpath:/dist/\n# web 界面的配置\n# 服务的接口url地址, 默认为空, 表示使用浏览器访问的地址\nweb.config.serverUrl=\n# 密码传输是否使用加密\nweb.config.passwordEncryption=true\n# OAuth2 客户端id\nweb.config.clientId=admin_client\n# OAuth2 秘钥\nweb.config.clientSecret=f640e16a951b4109a88cf0fcd4d66a63\n\n#i18n服务地址\nhairou-i18n.client.host=http://nova-haiq-i18n\n#本应用在i18n服务中的标识\nhairou-i18n.client.app-code=hairoutech-user\n#应用从i18n服务获取词条时间间隔\nhairou-i18n.client.pull-interval=30\n\n#设置http header大小，保证大token能顺利传递\nserver.max-http-header-size=1024000\n\n#前端登陆页面的 url (hairoutech-user-4.0.0.8及之后的版本必填，地址修改为对应环境的)\noauth.config.userLoginUrl=http://172.18.81.86:9001/signin\noauth.config.project=ADIDAS\n',
        'c0caae5588af115a9d9557d867069382', '2021-09-15 20:18:06', '2022-01-27 05:56:29', NULL, '172.18.32.65', '',
        'nova_prod', '', '', '', 'properties', '');
INSERT INTO `config_info`
VALUES (598, 'iwms-core', 'iwms',
        'spring:  \n      \n  datasource:\n    driverClassName: net.sf.log4jdbc.DriverSpy\n    type: com.zaxxer.hikari.HikariDataSource\n    url: jdbc:log4jdbc:mysql://nova-mysql:3306/iwms_core?useSSL=false&serverTimezone=Asia/Shanghai&useUnicode=true&characterEncoding=utf8&allowPublicKeyRetrieval=true\n    username: root\n    password: root\n    hikari:\n      minimum-idle: 5\n      idle-timeout: 180000\n      maximum-pool-size: 100\n      auto-commit: true\n      pool-name: ${spring.application.name}_datasource_pool\n      max-lifetime: 1800000\n      connection-timeout: 30000\n      connection-test-query: SELECT 1\n      \n  cloud:\n    # Nacos 的相关配置\n    nacos:\n      discovery:\n        server-addr: nova-nacos:8848\n        namespace: nova_prod\n        username: nacos\n        password: nacos\n        # 要注意，当使用本地开发环境的时候，这个组必须要和其他人的不一样，不然会混用。\n        group: HAIQ\n        \n  liquibase:\n    # liquibase配置路径 classpath*:liquibase.xml\n    change-log: classpath*:liquibase.xml\n    # changelog的表名,表中会记录每次升级执行的脚本\n    database-change-log-table: lqb_change_log\n    # 记录每次产生锁的表名\n    database-change-log-lock-table: lqb_change_log_lock\n\n  jackson:\n    date-format: \'yyyy-MM-dd HH:mm:ss\'\n    time-zone: \'Asia/Shanghai\'\n    # JsonInclude.Include\n    default-property-inclusion: NON_NULL\n\n  kafka:\n    consumer:\n      bootstrap-servers: nova-kafka:9092\n      auto-offset-reset: earliest\n\n    producer:\n      bootstrap-servers: nova-kafka:9092\n      retries: 3\n\n  servlet:\n    multipart:\n      max-file-size: 20MB\n      max-request-size: 20MB\n\n  application:\n    name: iwms-core\n\n  redis:\n    host: nova-redis\n    port: 6379\n    database: 2\n\n####以上的都不用关注，所有的现场一致####\niwms:\n  schedule:\n    config:\n    ### 出库订单缺货等待超时时间（分钟）\n      outboundOrderShortWaitingMinute: 5\n    ### 定时任务  \n      handleShortWaitingOrder: 0 0/1 * * * ?\n\n# 下面这个2个配置都是 mock 用的。\nmock:\n  station:\n    url: localhost:7301\n  core:\n    url: localhost:7201\n\n#设置http header大小，保证大token能顺利传递\nserver:\n  max-http-header-size: 1024000\n\n\niwms.schedule.config.handleEssContainerTask: 1000  \n\nlogging:\n    config: classpath:logback-nacos.xml\n    #文件大小达到多少，将进行归档\n    max-file-size: 250MB\n    #根据客户要求配置（注意现在以小时滚动，保留天要设置成*24。下面设置的168就是保存7天的日志，超过7天会白动删除)\n    max-history: 168 \n    #根据现场磁盘空间配置(需要考虑其他应用】\n    total-size-cap: 50GB',
        '6ba5f07996f53a914219ef504ad96386', '2021-09-15 20:18:06', '2022-10-25 07:13:36', NULL, '192.168.83.1', '',
        'nova_prod', '', '', '', 'yaml', '');
INSERT INTO `config_info`
VALUES (599, 'iwms-station', 'iwms',
        '\nspring:\n  cloud:\n    nacos:\n      discovery:\n        server-addr: nova-nacos:8848\n        namespace: nova_prod\n        username: nacos\n        password: nacos\n        group: HAIQ\n\n  liquibase:\n    # liquibase配置路径 classpath*:liquibase.xml\n    change-log: classpath*:liquibase.xml\n    # changelog的表名,表中会记录每次升级执行的脚本\n    database-change-log-table: lqb_change_log\n    # 记录每次产生锁的表名\n    database-change-log-lock-table: lqb_change_log_lock\n\n  jackson:\n    date-format: \'yyyy-MM-dd HH:mm:ss\'\n    time-zone: \'Asia/Shanghai\'\n    # JsonInclude.Include\n    default-property-inclusion: NON_NULL\n\n  kafka:\n    consumer:\n      bootstrap-servers: nova-kafka:9092\n      auto-offset-reset: latest\n\n    producer:\n      bootstrap-servers: nova-kafka:9092\n      retries: 3\n    \n  servlet:\n    multipart:\n      max-file-size: 20MB\n      max-request-size: 20MB\n\n  application:\n    name: iwms-station\n\n  datasource:\n    driverClassName: net.sf.log4jdbc.DriverSpy\n    type: com.zaxxer.hikari.HikariDataSource\n    url: jdbc:log4jdbc:mysql://nova-mysql:3306/iwms_station?useSSL=false&serverTimezone=Asia/Shanghai&useUnicode=true&characterEncoding=utf8&allowPublicKeyRetrieval=true\n    username: root\n    password: root\n    hikari:\n      minimum-idle: 5\n      idle-timeout: 180000\n      maximum-pool-size: 100\n      auto-commit: true\n      pool-name: ${spring.application.name}_datasource_pool\n      max-lifetime: 1800000\n      connection-timeout: 30000\n      connection-test-query: SELECT 1\n\n  jpa:\n    # 数据库类型\n    database: mysql\n    # 是否打印 sql ,不打印，log4jdbc打印sql\n    show-sql: false\n    # 是否自动创建 table\n    generate-ddl: true\n    database-platform: org.hibernate.dialect.MySQL57InnoDBDialect\n    hibernate:\n      # create – Hibernate first drops existing tables, then creates new tables\n      # update – the object model created based on the mappings (annotations or XML) is compared with the existing schema, and then Hibernate updates the schema according to the diff. It never deletes the existing tables or columns even if they are no more required by the application\n      # create-drop – similar to create, with the addition that Hibernate will drop the database after all operations are completed. Typically used for unit testing\n      # validate – Hibernate only validates whether the tables and columns exist, otherwise it throws an exception\n      # none – this value effectively turns off the DDL generation\n      ddl-auto: update\n    properties:\n      hibernate:\n        format_sql: true\n        use_sql_comments: true\n        physical_naming_strategy: org.springframework.boot.orm.jpa.hibernate.SpringPhysicalNamingStrategy\n\n  redis:\n    # host: 172.20.8.209\n    host: nova-redis\n    port: 6379\n    database: 2\n\ndubbo:\n  application:\n    id: iwms-station\n    name: iwms-station\n  scan:\n    base-packages: com.hairoutech\n  protocol:\n    name: dubbo\n    port: -1\n  registry:\n    address: spring-cloud://localhost\n    timeout: 10000\n  cloud:\n    subscribed-services: iwms-core\n  consumer:\n    check: false\n    # dubbo 的全局超时时间改为10秒。\n    timeout: 1000\n    filter: dubboContextFilter  \n\ntopics:\n  iwms:\n    station:\n      websocket: iwms-station-websocket-test-20210709\n\n####以上的都不用关注，所有的现场一致####\n\n#设置http header大小，保证大token能顺利传递\nserver:\n  max-http-header-size: 1024000\n\nlogging:\n    config: classpath:logback-nacos.xml\n    #文件大小达到多少，将进行归档\n    max-file-size: 250MB\n    #根据客户要求配置（注意现在以小时滚动，保留天要设置成*24。下面设置的168就是保存7天的日志，超过7天会白动删除)\n    max-history: 168 \n    #根据现场磁盘空间配置(需要考虑其他应用】\n    total-size-cap: 50GB  ',
        'e2848fb6d274d480f6dc66e9e1f58885', '2021-09-15 20:18:06', '2022-10-25 07:13:56', NULL, '192.168.83.1', '',
        'nova_prod', '', '', '', 'yaml', '');
INSERT INTO `config_info`
VALUES (600, 'iwms-quartz.yml', 'iwms',
        'spring:\n  quartz:\n    #数据库方式\n    job-store-type: jdbc\n    jdbc:\n      initialize-schema: always\n      comment-prefix: \'#\'\n    #相关属性配置\n    properties:\n      org:\n        quartz:\n          scheduler:\n            instanceName: clusteredScheduler\n            instanceId: AUTO\n          #配置数据源\n          #数据库中quartz表的表名前缀\n          ##springboot 会默认mysql数据库\n          jobStore:\n            class: org.quartz.impl.jdbcjobstore.JobStoreTX\n            driverDelegateClass: org.quartz.impl.jdbcjobstore.StdJDBCDelegate\n            tablePrefix: QRTZ_\n            isClustered: true\n            clusterCheckinInterval: 10000\n            useProperties: false\n          threadPool:\n            class: org.quartz.simpl.SimpleThreadPool\n            threadCount: 10\n            threadPriority: 5\n            threadsInheritContextClassLoaderOfInitializingThread: true\n\n    datasource:\n      driverClassName: net.sf.log4jdbc.DriverSpy\n      # 使用druid数据源\n      type: com.zaxxer.hikari.HikariDataSource\n      # jdbcUrl: jdbc:log4jdbc:mysql://172.20.8.209:3306/iwms_quartz_test?useSSL=false&serverTimezone=Asia/Shanghai&useUnicode=true&characterEncoding=utf8&allowPublicKeyRetrieval=true\n      jdbcUrl: jdbc:log4jdbc:mysql://nova-mysql:3306/iwms_quartz?useSSL=false&serverTimezone=Asia/Shanghai&useUnicode=true&characterEncoding=utf8&allowPublicKeyRetrieval=true\n      username: root\n      password: root\n      hikari:\n        minimum-idle: 5\n        idle-timeout: 180000\n        maximum-pool-size: 10\n        auto-commit: true\n        pool-name: ${spring.application.name}_datasource_pool\n        max-lifetime: 1800000\n        connection-timeout: 30000\n        connection-test-query: SELECT 1            \n   \n\n ',
        'f57383e57e75d83215b4e9ce0525b1b3', '2021-09-15 20:18:06', '2021-09-15 20:18:06', NULL, '172.17.0.1', '',
        'nova_prod', NULL, NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info`
VALUES (601, 'iwms-adapter', 'iwms',
        '\nspring:\n  cloud:\n    nacos:\n      discovery:\n        server-addr: nova-nacos:8848\n        namespace: nova_prod\n        username: nacos\n        password: nacos\n        group: HAIQ\n\n  jackson:\n    date-format: \'yyyy-MM-dd HH:mm:ss\'\n    time-zone: \'Asia/Shanghai\'\n    # JsonInclude.Include\n    default-property-inclusion: NON_NULL\n\n  kafka:\n    consumer:\n      bootstrap-servers: nova-kafka:9092\n      auto-offset-reset: earliest\n\n    producer:\n      bootstrap-servers: nova-kafka:9092\n      retries: 3\n    \n  servlet:\n    multipart:\n      max-file-size: 20MB\n      max-request-size: 20MB\n \n  application:\n    name: iwms-adapter\n\ndubbo:\n  application:\n    id: iwms-adapter\n    name: iwms-adapter\n  consumer:\n    check: false\n  scan:\n    base-packages: com.hairoutech\n  protocol:\n    name: dubbo\n#    port: -1\n  registry:\n    address: spring-cloud://localhost\n    timeout: 10000\n  cloud:\n    subscribed-services: iwms-core\n\n# 模板配置\ntemplate:\n  request:\n    enable: false\n    response: V1\n    # 模板列表,Key——ApiType,value——模板编号\n    tplList:\n      ORDER_INBOUND_CREATE: V1\n  callback:\n    result: V1\n    # 模板列表,Key——CallbackType,api——接口平台api code（默认使用CallbackType），tplVersion——模板编号，batchMode——批量模式（默认List），ignore——是否忽略回传\n    tplList:\n      INBOUND_RECEIVED_CALLBACK:\n        tplVersion: V1\n\n# 接口平台\nhai-link:\n  config:\n    fromApp: 003YD5\n    toApp: 7U6B5J\n    url: dubbo://nova-haiq-link-app:20883\n    # url: http://172.20.110.13:8081\n    keys: 0ed9a35f13224e21a656cd0b143a7d8e\n    interfaceName: com.hairoutech.link.app.request.rpc.DubboProxyService\n    methodName: invoke\n    version: 1.0.0\n    timeout: 10000\n\n# i18n\nhairou-i18n:\n  client:\n    host: http://nova-haiq-i18n\n    app-code: iwms',
        'd34ae9d1c4bfcb7b5ff830fb51f74ab6', '2021-09-15 20:18:06', '2021-12-10 03:00:53', NULL, '172.17.0.1', '',
        'nova_prod', '', '', '', 'yaml', '');
INSERT INTO `config_info`
VALUES (602, 'iwms-third-party-call.yml', 'iwms',
        '## 调用ess模块的地址\ness:\n   sdk:\n     uri:       \n       essPURI: http://192.168.83.128:9000\n       fetchStationMetadataURI: wms/stationQuery\n       createOutboundURI: tms/createWmsOutboundTask\n       createInboundURI: wms/createWmsInboundTask\n       locationQueryURI: wms/locationQuery\n       cancelWmsTaskURI: wms/cancelWmsTask\n       containerMoveInURI: container/moveIn\n       containerMoveOutURI: container/moveOut\n       createContainerURI: container/add\n       containerTypeURI: model/queryModelByType?modelType=container_type\n       containerLeaveURI: tms/conveyorMoveContainer\n       releaseShelfGroupURI: station/changeGroupLock\n       callRobotURI: station/callRobot\n       letRobotGoURI: station/letRobotGo  \n       sendPtlActionURI: equipment/ptl/sendCommand\n       updatePtlAddressURI: equipment/ptl/updateAddress\n       createWmsCheckTaskURI: wms/createWmsCheckTask\n       queryModelByCodeURI: model/queryModelByCode\n       queryAllLocationURI: model/queryModelByType?modelType=location\n       queryLocationByPageURI: location/query\n       sendStationStatusURI: tms/wmsStationStateNoticed\n       queryConveyorURI: equipment/conveyor/queryConveyor\n       getLocationSummaryURI: location/summary\n    ##调用ess使用哪种模式，MOCK：mock ess，HTTP: 真实ESS  \n     essServiceType: HTTP\n     locationTypeCode: LT_SHELF_STORAGE\n    ##入库模板\n     template:\n       inboundTemplate: TOTE_INBOUND\n\n#####共享平台配置#####\nhairou-i18n:\n  client:\n    host: http://nova-haiq-i18n\n    app-code: iwms\n    \n# core中的仪表盘依赖于station的数据，需要通过feignClient获取\nfeign:\n  client:\n    url:\n      station: http://nova-iwms-station:7301\n',
        '20a0aa87a4b394e9a2f8368a48415974', '2021-09-15 20:18:06', '2022-10-10 06:12:07', NULL, '192.168.83.1', '',
        'nova_prod', '', '', '', 'yaml', '');
INSERT INTO `config_info`
VALUES (603, 'iwms-plugin.yml', 'iwms',
        '##扩展点定义41\nextract:\n  coordinate:\n    config:\n      virtualStationExtractCoordinateDTO:\n        bus: \"iwms_bus\"\n        scene: \"outbound\"\n        useCase: \"virtual_station\"\n        compulsory: false\n      outboundOrderSplitExtension:\n        bus: \"iwms_core\"\n        scene: \"outbound\"\n        useCase: \"order_processor\"\n        compulsory: false\n      # 配置入库分区插件\n      putAwayExtractCoordinateDTO:\n        bus: \"iwms_core\"\n        scene: \"inbound\"\n        useCase: \"putAway\"\n        compulsory: false\n      barcodeResolveRuleDTO:\n        bus: \"iwms-core\"\n        scene: \"pick\"\n        useCase: \"scanCode\"\n        compulsory: false\n\n# 插件的配置\nplugin:\n  storeHost: http://plugin-test.hairoutech.com\n  # 插件运行模式. dev: 开发环境, prod: 生产环境\n  runMode: prod\n  # 是否启用插件\n  enable: true\n  # 插件存放的目录\n  pluginPath: /persistence/plugin/plugin\n  # 生产环境下, 插件文件的路径. 只在生产环境下生效\n  pluginConfigFilePath: /persistence/plugin/plugin-configs\n  # 插件rest接口前缀\n  pluginRestPathPrefix: /api/plugins/\n  # 在卸载插件后, 备份插件的目录\n  backupPath: /persistence/plugin/backupPlugin\n  # 上传的插件所存储的临时目录\n  uploadTempPath: /persistence/plugin/temp\n  # 禁用的插件id, 禁用后系统不会启动该插件. 为Set集合. 配置案例如下:\n  # disablePluginIds:\n  #   - disable-id1\n  #   - disable-id2\n  project:\n    version: 0.0.0      ',
        '98ce74527dff0ddbbd9c24cd9d3080c7', '2021-09-15 20:18:06', '2021-10-10 01:33:56', NULL, '172.17.0.1', '',
        'nova_prod', '', '', '', 'yaml', '');
