INSERT INTO `config_info`
VALUES (659, 'application-export-excel.yml', 'iwms',
        '# 此配置用于导出功能。\n# 注意：\n# 1. 需要导出的字段必须要存在才行。\n# 2. 允许有字段转义。需要自行设置转义内容。\n\ndownload:\n  config:\n    customer:\n      excelSymbol: customer\n      serviceName: \"com.hairoutech.iwms.core.business.basedata.warehouse.service.CustomerService\"\n      methodName: \"searchCustomer\"\n      downloadPrefix: customer\n      exportLimitNumber: 100000\n      ## 需要转义显示的字段\n      valueMap:\n        KsCustomer.type: customerType\n        KsCustomer.status: enableOrDisable\n      # 字段为Map,查询里面的Key\n      fieldMap:\n        \"KsCustomer.contacts\": \"tel,fax\"\n      # 表头和对象之间的关系\n      columnMapper:\n        \"[KsCustomer.id]\": 序号\n        \"[KsWarehouse.code]\": 仓库编码\n        \"[KsCustomer.code]\": 编码\n        \"[KsCustomer.name]\": 名称\n        \"[KsCustomer.type]\": 类型\n        \"[KsCustomer.status]\": 状态\n        \"[KsCustomer.tel]\": 电话\n        \"[KsCustomer.fax]\": 传真\n\n    skuInfo:\n      excelSymbol: skuInfo\n      serviceName: \"com.hairoutech.iwms.core.business.basedata.sku.service.KsSkuService\"\n      methodName: \"search\"\n      downloadPrefix: skuInfo\n      exportLimitNumber: 100000\n      # 表头和对象之间的关系\n      columnMapper:\n        \"[KsSku.ksWarehouseCode]\": 仓库编码\n        \"[KsSku.ksCustomerCode]\": 货主编码\n        \"[KsSku.skuCode]\": 商品编码\n        \"[KsSku.skuName]\": 商品名称\n        \"[BaseMysqlTimePojo.createTime]\": 创建时间\n\n    inboundOrder:\n      excelSymbol: inboundOrder\n      serviceName: \"com.hairoutech.iwms.core.business.order.management.inbound.service.InboundOrderService\"\n      methodName: \"searchInboundOrder\"\n      downloadPrefix: inboundOrder\n      exportLimitNumber: 100000\n      valueMap:\n        KsInboundOrder.inboundOrderStatus: inboundOrderStatus\n        KsInboundOrder.abnormal: trueOrFalse\n      columnMapper:\n        \"[KsInboundOrder.orderNo]\": 入库单号\n        \"[KsInboundOrder.warehouseCode]\": 仓库编码\n        \"[KsInboundOrder.customerCode]\": 货主编码\n        \"[KsInboundOrder.inboundOrderType]\": 入库类型\n        \"[KsInboundOrder.inboundOrderStatus]\": 状态\n        \"[KsInboundOrder.abnormal]\": 是否异常\n        \"[KsInboundOrder.supplier]\": 供应商\n        \"[KsInboundOrder.customerOrderNo]\": 客户单号\n        \"[KsInboundOrder.lpnCode]\": LPN号\n\n    putAwayTask:\n      excelSymbol: putAwayTask\n      serviceName: \"com.hairoutech.iwms.core.business.order.management.putaway.service.PutAwayTaskService\"\n      methodName: \"searchPutAwayTask\"\n      downloadPrefix: putAwayTask\n      exportLimitNumber: 100000\n      valueMap:\n        KsPutAwayTask.putAwayTaskStatus: putAwayTaskStatus\n      columnMapper:\n        \"[KsPutAwayTask.warehouseCode]\": 仓库编码\n        \"[KsPutAwayTask.taskNo]\": 上架任务号\n        \"[KsPutAwayTask.containerCode]\": 容器号\n        \"[KsPutAwayTask.putAwayTaskStatus]\": 上架状态\n        \"[BaseMysqlTimePojo.createTime]\": 创建时间\n        \"[BaseMysqlTimePojo.updateTime]\": 完成时间\n\n    outboundOrder:\n      excelSymbol: outboundOrder\n      serviceName: \"com.hairoutech.iwms.core.business.order.management.outbound.service.OutboundOrderService\"\n      methodName: \"searchOutboundOrder\"\n      downloadPrefix: outboundOrder\n      exportLimitNumber: 100000\n      valueMap:\n        KsOutboundOrderBasePojo.outboundOrderStatus: outboundOrderStatus\n        KsOutboundOrder.abnormal: outboundOrderAbnormal\n        KsOutboundOrderBasePojo.multiple: outboundOrderStruct\n      columnMapper:\n        \"[KsOutboundOrderBasePojo.warehouseCode]\": 仓库编码\n        \"[KsOutboundOrderBasePojo.customerCode]\": 货主编码\n        \"[KsOutboundOrderBasePojo.orderNo]\": 出库单号\n        \"[KsOutboundOrderBasePojo.customerOrderNo]\": 客户单号\n        \"[KsOutboundOrderBasePojo.multiple]\": 订单结构\n        \"[KsOutboundOrder.abnormal]\": 是否异常\n        \"[KsOutboundOrderBasePojo.outboundOrderStatus]\": 状态\n\n    stock:\n      excelSymbol: stock\n      serviceName: \"com.hairoutech.iwms.core.business.stock.service.KsStockService\"\n      methodName: \"searchKsStocks\"\n      downloadPrefix: stock\n      exportLimitNumber: 100000\n      columnMapper:\n        \"[KsStockVO.ksWarehouseCode]\": 仓库编码\n        \"[KsStockVO.ksCustomerCode]\": 货主\n        \"[KsStockVO.ksWarehouseAreaCode]\": 库区\n        \"[KsStockVO.ksWarehouseLogicCode]\": 逻辑区\n        \"[KsStockVO.containerCode]\": 容器号\n        \"[KsStockVO.subContainerCode]\": 容器格口\n        \"[KsStockVO.skuCode]\": 商品编码\n        \"[KsStockVO.skuName]\": 商品名称\n        \"[KsStockVO.qtyActual]\": 库存数量\n        \"[KsStockVO.qtyLocked]\": 锁定数量\n        \"[KsStockVO.outboundQtyLocked]\": 出库占用\n        \"[KsStockVO.inboundQtyLocked]\": 库内占用\n        \"[KsStockVO.stocktakeQtyDiffLocked]\": 盘亏占用\n        \"[KsStockVO.outboundQtyDiffLocked]\": 报缺占用\n        \"[KsStockVO.qtyAvailable]\": 可用数量\n\n    stocktakeOrder:\n      excelSymbol: stocktakeOrder\n      serviceName: \"com.hairoutech.iwms.core.business.order.management.stocktake.service.StocktakeOrderService\"\n      methodName: \"searchStocktakeOrder\"\n      downloadPrefix: stocktakeOrder\n      exportLimitNumber: 100000\n      valueMap:\n        KsStocktakeOrder.status: stocktakeOrderStatus\n        KsStocktakeOrder.stocktakeType: stocktakeType\n        KsStocktakeOrder.stocktakeCreateMethod: stocktakeCreateMethod\n        KsStocktakeOrder.stocktakeCreateType: stocktakeCreateType\n        KsStocktakeOrder.suspendMark: trueOrFalse\n        KsStocktakeOrder.diffMark: trueOrFalse\n      columnMapper:\n        \"[KsStocktakeOrder.orderNo]\": 盘点单编号\n        \"[KsStocktakeOrder.ksWarehouseCode]\": 仓库\n        \"[KsStocktakeOrder.status]\": 状态\n        \"[KsStocktakeOrder.stocktakeType]\": 盘点类型\n        \"[KsStocktakeOrder.stocktakeCreateMethod]\": 创建方式\n        \"[KsStocktakeOrder.stocktakeCreateType]\": 创建类型\n        \"[KsStocktakeOrder.suspendMark]\": 挂单标识\n        \"[KsStocktakeOrder.diffMark]\": 异常标识\n        \"[KsStocktakeOrder.createUser]\": 创建人\n\n    toteRelocationOrder:\n      excelSymbol: toteRelocationOrder\n      serviceName: \"com.hairoutech.iwms.core.business.order.management.inventory.relocation.service.InventoryRelocationService\"\n      methodName: \"searchToteRelocationOrder\"\n      downloadPrefix: toteRelocationOrder\n      exportLimitNumber: 100000\n      valueMap:\n        KsToteRelocationOrder.status: toteRelocationOrderStatus\n      columnMapper:\n        \"[KsToteRelocationOrder.warehouseCode]\": 仓库\n        \"[KsToteRelocationOrder.orderNo]\": 理库单号\n        \"[KsToteRelocationOrder.status]\": 状态\n        \"[KsToteRelocationOrder.createUser]\": 创建人\n        \"[BaseMysqlTimePojo.createTime]\": 创建时间\n        \"[KsToteRelocationOrder.updateUser]\": 编辑人\n        \"[BaseMysqlTimePojo.updateTime]\": 编辑时间\n\n    stockAdjust:\n      excelSymbol: stockAdjust\n      serviceName: \"com.hairoutech.iwms.core.business.order.management.inventoryadjustment.service.KsInventoryAdjustmentService\"\n      methodName: \"searchOrder\"\n      downloadPrefix: stockAdjust\n      exportLimitNumber: 100000\n      valueMap:\n        KsInventoryAdjustmentOrderVO.status: commonProcessStatus\n      columnMapper:\n        \"[KsInventoryAdjustmentOrderVO.ksWarehouseCode]\": 仓库编码\n        \"[KsInventoryAdjustmentOrderVO.orderNo]\": 调整单号\n        \"[KsInventoryAdjustmentOrderVO.customerCode]\": 货主\n        \"[KsInventoryAdjustmentOrderVO.status]\": 状态\n        \"[KsInventoryAdjustmentOrderVO.createUser]\": 创建人\n        \"[KsInventoryAdjustmentOrderVO.createTime]\": 创建时间\n\n    stockAbnormal:\n      excelSymbol: stockAbnormal\n      serviceName: \"com.hairoutech.iwms.core.business.monitor.inventory.service.InventoryDiffService\"\n      methodName: \"search\"\n      downloadPrefix: stockAbnormal\n      exportLimitNumber: 100000\n      valueMap:\n        InventoryDiffVO.inventoryDiffType: inventoryDiffType\n      columnMapper:\n        \"[InventoryDiffVO.diffNo]\": 异常单号\n        \"[InventoryDiffVO.inventoryDiffType]\": 异常类型\n        \"[InventoryDiffVO.warehouseCode]\": 仓库\n        \"[InventoryDiffVO.customerCode]\": 货主\n        \"[InventoryDiffVO.createUser]\": 创建人\n        \"[InventoryDiffVO.createTime]\": 创建时间\n\n    emptyContainerOutboundOrder:\n      excelSymbol: emptyContainerOutboundOrder\n      serviceName: \"com.hairoutech.iwms.core.business.order.management.emptycontaineroutbound.service.EmptyContainerOutboundOrderService\"\n      methodName: \"searchEmptyContainerOutboundOrder\"\n      downloadPrefix: emptyContainerOutboundOrder\n      exportLimitNumber: 100000\n      valueMap:\n        KsEmptyContainerOutboundOrder.emptyContainerOutboundStatus: emptyContainerOutboundStatus\n      columnMapper:\n        \"[KsEmptyContainerOutboundOrder.orderNo]\": 出库单号\n        \"[KsEmptyContainerOutboundOrder.emptyContainerOutboundStatus]\": 任务状态\n        \"[KsEmptyContainerOutboundOrder.stationCode]\": 工作站code\n        \"[KsEmptyContainerOutboundOrder.requireCount]\": 计划数量\n        \"[KsEmptyContainerOutboundOrder.actualCount]\": 实际数量\n        \"[BaseMysqlUserPojo.createUser]\": 创建人\n        \"[BaseMysqlTimePojo.createTime]\": 创建时间\n\n    stockRecord:\n      excelSymbol: stockRecord\n      serviceName: \"com.hairoutech.iwms.core.business.stock.service.KsStockRecordService\"\n      methodName: \"search\"\n      downloadPrefix: stockRecord\n      exportLimitNumber: 100000\n      valueMap:\n        KsStockRecord.lockType: coreBusinessType\n        KsStockRecord.orderType: orderType\n      columnMapper:\n        \"[KsStockRecord.skuCode]\": 商品编码\n        \"[KsStockRecord.containerCode]\": 容器号\n        \"[KsStockRecord.subContainerCode]\": 格口号\n        \"[KsStockRecord.qtyActualDelta]\": 库存变化量\n        \"[KsStockRecord.lockType]\": 关联业务\n        \"[KsStockRecord.orderType]\": 关联单类型\n        \"[KsStockRecord.orderNo]\": 关联单号\n        \"[BaseMysqlUserPojo.createUser]\": 操作人\n        \"[BaseMysqlTimePojo.updateTime]\": 操作时间\n\n    sysConfig:\n      excelSymbol: sysConfig\n      serviceName: \"com.hairoutech.iwms.core.business.config.sysConfig.service.SysConfigService\"\n      methodName: \"searchConfig\"\n      downloadPrefix: sysConfig\n      exportLimitNumber: 100000\n      valueMap:\n        KsSysConfig.kind: sysConfigParamKind\n        KsSysConfig.type: sysConfigParamType\n      columnMapper:\n        \"[KsSysConfig.code]\": 参数代码\n        \"[KsSysConfig.description]\": 参数描述\n        \"[KsSysConfig.kind]\": 参数分类\n        \"[KsSysConfig.type]\": 参数类型\n        \"[BaseMysqlUserPojo.updateUser]\": 编辑人\n        \"[BaseMysqlTimePojo.updateTime]\": 编辑时间',
        'cf32a08ca25ab965fccabb7df060eb5d', '2021-09-29 08:34:05', '2021-12-10 03:44:32', NULL, '172.17.0.1', '',
        'nova_prod', '', '', '', 'yaml', '');
INSERT INTO `config_info`
VALUES (762, 'iwms-help', 'iwms',
        '\nspring:\n  cloud:\n    # Nacos 的相关配置\n    nacos:\n      discovery:\n        server-addr: nova-nacos:8848\n        namespace: nova_prod\n        username: nacos\n        password: nacos\n        # 要注意，当使用本地开发环境的时候，这个组必须要和其他人的不一样，不然会混用。\n        group: HAIQ\n\n  datasource:\n    \n    type: com.alibaba.druid.pool.DruidDataSource\n\n    db-core:       \n      url: jdbc:mysql://nova-mysql:3306/iwms_core?useSSL=false&serverTimezone=Asia/Shanghai&useUnicode=true&characterEncoding=utf8&allowPublicKeyRetrieval=true\n      username: root\n      password: root\n      driverClassName: com.mysql.cj.jdbc.Driver\n\n    db-station: \n      url: jdbc:mysql://nova-mysql:3306/iwms_station?useSSL=false&serverTimezone=Asia/Shanghai&useUnicode=true&characterEncoding=utf8&allowPublicKeyRetrieval=true\n      username: root\n      password: root\n      driverClassName: com.mysql.cj.jdbc.Driver\n\n    druid:\n      # 连接池初始化大小，最小，最大\n      initial-size: 1\n      minIdle: 5\n      maxActive: 100\n      # 配置获取连接等待超时的时间（毫秒）\n      maxWait: 30000\n      # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接（毫秒）\n      timeBetweenEvictionRunsMillis: 60000\n      # 配置一个连接在池中最小生存的时间（毫秒）\n      minEvictableIdleTimeMillis: 30000\n      validationQuery: select 1\n      testWhileIdle: true\n      testOnBorrow: false\n      testOnReturn: false\n      # 打开PSCache，并且指定每个连接上PSCache的大小\n      poolPreparedStatements: true\n      maxPoolPreparedStatementPerConnectionSize: 20\n      # 配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n      filters: stat,wall,slf4j\n      # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n      connectionProperties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n      # 配置DruidStatFilter\n      web-stat-filter:\n        enabled: true\n        url-pattern: \"/*\"\n        exclusions: \"*.js,*.gif,*.jpg,*.bmp,*.png,*.css,*.ico,/druid/*\"\n      # 配置DruidStatViewServlet\n      stat-view-servlet:\n        enabled: true\n        url-pattern: \"/druid/*\"\n        # 禁用HTML页面上的“Reset All”功能\n        reset-enable: false\n        # 登录名\n        login-username: admin\n        # 登录密码\n        login-password: admin\n\n  redis:\n    host: nova-redis\n    port: 6379\n    database: 2\n\n',
        'db2b0731ba3d75db299a46ee6421f188', '2022-01-15 02:52:56', '2022-01-15 02:52:56', NULL, '172.18.32.238', '',
        'nova_prod', NULL, NULL, NULL, 'yaml', NULL);
INSERT INTO `config_info`
VALUES (763, 'iwms-op', 'iwms',
        '\nspring:\n  cloud:\n    # Nacos 的相关配置\n    nacos:\n      discovery:\n        server-addr: nova-nacos:8848\n        namespace: nova_prod\n        username: nacos\n        password: nacos\n        # 要注意，当使用本地开发环境的时候，这个组必须要和其他人的不一样，不然会混用。\n        group: HAIQ\n\n  datasource:\n    \n    type: com.alibaba.druid.pool.DruidDataSource\n\n    db-core:       \n      url: jdbc:mysql://nova-mysql:3306/iwms_core_2021?useSSL=false&serverTimezone=Asia/Shanghai&useUnicode=true&characterEncoding=utf8&allowPublicKeyRetrieval=true\n      username: root\n      password: root\n      driverClassName: com.mysql.cj.jdbc.Driver\n\n    db-station: \n      url: jdbc:mysql://nova-mysql:3306/iwms_station_2021?useSSL=false&serverTimezone=Asia/Shanghai&useUnicode=true&characterEncoding=utf8&allowPublicKeyRetrieval=true\n      username: root\n      password: root\n      driverClassName: com.mysql.cj.jdbc.Driver\n\n    druid:\n      # 连接池初始化大小，最小，最大\n      initial-size: 1\n      minIdle: 5\n      maxActive: 100\n      # 配置获取连接等待超时的时间（毫秒）\n      maxWait: 30000\n      # 配置间隔多久才进行一次检测，检测需要关闭的空闲连接（毫秒）\n      timeBetweenEvictionRunsMillis: 60000\n      # 配置一个连接在池中最小生存的时间（毫秒）\n      minEvictableIdleTimeMillis: 30000\n      validationQuery: select 1\n      testWhileIdle: true\n      testOnBorrow: false\n      testOnReturn: false\n      # 打开PSCache，并且指定每个连接上PSCache的大小\n      poolPreparedStatements: true\n      maxPoolPreparedStatementPerConnectionSize: 20\n      # 配置监控统计拦截的filters，去掉后监控界面sql无法统计，\'wall\'用于防火墙\n      filters: stat,wall,slf4j\n      # 通过connectProperties属性来打开mergeSql功能；慢SQL记录\n      connectionProperties: druid.stat.mergeSql=true;druid.stat.slowSqlMillis=5000\n      # 配置DruidStatFilter\n      web-stat-filter:\n        enabled: true\n        url-pattern: \"/*\"\n        exclusions: \"*.js,*.gif,*.jpg,*.bmp,*.png,*.css,*.ico,/druid/*\"\n      # 配置DruidStatViewServlet\n      stat-view-servlet:\n        enabled: true\n        url-pattern: \"/druid/*\"\n        # 禁用HTML页面上的“Reset All”功能\n        reset-enable: false\n        # 登录名\n        login-username: admin\n        # 登录密码\n        login-password: admin\n\n  redis:\n    host: nova-redis\n    port: 6379\n    database: 2\n\ndubbo:\n  application:\n    id: iwms-op\n    name: iwms-op\n  scan:\n    base-packages: com.hairoutech\n  protocol:\n    name: dubbo\n    port: -1\n  registry:\n    address: spring-cloud://localhost\n    timeout: 10000\n  cloud:\n    subscribed-services: iwms-core,iwms-station\n  consumer:\n    check: false\n    # dubbo 的全局超时时间改为10秒。\n    timeout: 30000\n    #filter: dubboContextFilter  \n',
        '31b46608e9eac82019333653cdb26143', '2022-01-15 02:53:43', '2022-10-20 04:36:16', NULL, '192.168.83.1', '',
        'nova_prod', '', '', '', 'yaml', '');
