INSERT INTO `config_info`
VALUES (1415, 'station', 'swms',
        'spring:  \r\n  datasource:\r\n    driverClassName: net.sf.log4jdbc.DriverSpy\r\n    type: com.zaxxer.hikari.HikariDataSource\r\n    url: jdbc:log4jdbc:mysql://nova-mysql:3306/iwms_core?useSSL=false&serverTimezone=Asia/Shanghai&useUnicode=true&characterEncoding=utf8&allowPublicKeyRetrieval=true\r\n    username: root\r\n    password: root\r\n    hikari:\r\n      minimum-idle: 5\r\n      idle-timeout: 180000\r\n      maximum-pool-size: 100\r\n      auto-commit: true\r\n      pool-name: ${spring.application.name}_datasource_pool\r\n      max-lifetime: 1800000\r\n      connection-timeout: 30000\r\n      connection-test-query: SELECT 1\r\n      \r\n  cloud:\r\n    # Nacos 的相关配置\r\n    nacos:\r\n      discovery:\r\n        server-addr: nova-nacos:8848\r\n        namespace: nova_prod\r\n        username: nacos\r\n        password: nacos\r\n        # 要注意，当使用本地开发环境的时候，这个组必须要和其他人的不一样，不然会混用。\r\n        group: swms\r\n        \r\n  liquibase:\r\n    # liquibase配置路径 classpath*:liquibase.xml\r\n    change-log: classpath*:liquibase.xml\r\n    # changelog的表名,表中会记录每次升级执行的脚本\r\n    database-change-log-table: lqb_change_log\r\n    # 记录每次产生锁的表名\r\n    database-change-log-lock-table: lqb_change_log_lock\r\n\r\n  jackson:\r\n    date-format: \'yyyy-MM-dd HH:mm:ss\'\r\n    time-zone: \'Asia/Shanghai\'\r\n    # JsonInclude.Include\r\n    default-property-inclusion: NON_NULL\r\n\r\n  kafka:\r\n    consumer:\r\n      bootstrap-servers: nova-kafka:9092\r\n      auto-offset-reset: earliest\r\n\r\n    producer:\r\n      bootstrap-servers: nova-kafka:9092\r\n      retries: 3\r\n\r\n  servlet:\r\n    multipart:\r\n      max-file-size: 20MB\r\n      max-request-size: 20MB\r\n\r\n  application:\r\n    name: iwms-core\r\n\r\n  redis:\r\n    host: nova-redis\r\n    port: 6379\r\n    database: 2\r\n\r\n####以上的都不用关注，所有的现场一致####\r\niwms:\r\n  schedule:\r\n    config:\r\n    ### 出库订单缺货等待超时时间（分钟）\r\n      outboundOrderShortWaitingMinute: 5\r\n    ### 定时任务  \r\n      handleShortWaitingOrder: 0 0/1 * * * ?\r\n\r\n# 下面这个2个配置都是 mock 用的。\r\nmock:\r\n  station:\r\n    url: localhost:7301\r\n  core:\r\n    url: localhost:7201\r\n\r\n#设置http header大小，保证大token能顺利传递\r\nserver:\r\n  max-http-header-size: 1024000\r\n\r\n\r\niwms.schedule.config.handleEssContainerTask: 1000  \r\n\r\nlogging:\r\n    config: classpath:logback-nacos.xml\r\n    #文件大小达到多少，将进行归档\r\n    max-file-size: 250MB\r\n    #根据客户要求配置（注意现在以小时滚动，保留天要设置成*24。下面设置的168就是保存7天的日志，超过7天会白动删除)\r\n    max-history: 168 \r\n    #根据现场磁盘空间配置(需要考虑其他应用】\r\n    total-size-cap: 50GB',
