VALUES (1416, 'station', 'swms',
        'spring:  \n  cloud:\n    # Nacos 的相关配置\n    nacos:\n      discovery:\n        server-addr: 192.168.83.128:8848\n        namespace: prod\n        username: nacos\n        password: nacos\n        # 要注意，当使用本地开发环境的时候，这个组必须要和其他人的不一样，不然会混用。\n        group: swms\n\n# application.yml\n  redis:\n    #  Redisson配置 spring.redisson.singleServerConfig\n    redisson:\n      config: |\n        singleServerConfig:\n          #  连接空闲超时，单位：毫秒\n          idleConnectionTimeout: 100000\n          #  连接超时，单位：毫秒\n          connectTimeout: 10000\n          #  命令等待超时，单位：毫秒\n          timeout: 3000\n          #  命令失败重试次数\n          retryAttempts: 3\n          #  命令重试发送时间间隔，单位：毫秒\n          retryInterval: 1500\n          #  密码\n          password: null\n          #  单个连接最大订阅数量\n          subscriptionsPerConnection: 5\n          #  客户端名称\n          clientName: null\n          #  节点地址\n          address: redis://192.168.83.128:6379\n          #  发布和订阅连接的最小空闲连接数\n          subscriptionConnectionMinimumIdleSize: 1\n          #  发布和订阅连接池大小\n          subscriptionConnectionPoolSize: 50\n          #  最小空闲连接数\n          connectionMinimumIdleSize: 32\n          #  连接池大小\n          connectionPoolSize: 64\n          #  redis数据库编号\n          database: 2\n          #  DNS监测时间间隔，单位：毫秒\n          dnsMonitoringInterval: 5000\n        #  线程池数量\n        threads: 0\n        #  Netty线程池数量\n        nettyThreads: 0\n        #  编码\n        codec:\n          class: \"org.redisson.codec.JsonJacksonCodec\"\n        #  传输模式\n        transportMode: \"NIO\"\n        #  配置看门狗的默认超时时间为30s，这里改为10s\n        lockWatchdogTimeout: 10000\n\n\n\n  liquibase:\n    # liquibase配置路径 classpath*:liquibase.xml\n    change-log: classpath*:liquibase.xml\n    # changelog的表名,表中会记录每次升级执行的脚本\n    database-change-log-table: lqb_change_log\n    # 记录每次产生锁的表名\n    database-change-log-lock-table: lqb_change_log_lock\n\n  jackson:\n    date-format: \'yyyy-MM-dd HH:mm:ss\'\n    time-zone: \'Asia/Shanghai\'\n    # JsonInclude.Include\n    default-property-inclusion: NON_NULL\n\n  servlet:\n    multipart:\n      max-file-size: 20MB\n      max-request-size: 20MB\n\n#设置http header大小，保证大token能顺利传递\nserver:\n  max-http-header-size: 1024000\n\nlogging:\n    config: classpath:logback-spring.xml\n    #文件大小达到多少，将进行归档\n    max-file-size: 250MB\n    #根据客户要求配置（注意现在以小时滚动，保留天要设置成*24。下面设置的168就是保存7天的日志，超过7天会白动删除)\n    max-history: 168 \n    #根据现场磁盘空间配置(需要考虑其他应用】\n    total-size-cap: 50GB\n\ndubbo:\n  application:\n    id: station\n    name: station\n  consumer:\n    check: false\n  scan:\n    base-packages: com.swms\n  protocol:\n    name: dubbo\n    port: -1\n  registry:\n    address: nacos://192.168.83.128:8848\n    timeout: 10000\n  cloud:\n    subscribed-services: wms\n#  consumer:\n#    filter: \'tracing\'\n#  provider:\n#    filter: \'tracing\'    ',
        '5f27d996acd27c9bb4ba6b815e69b4de', '2023-03-01 05:46:59', '2023-04-04 02:32:17', NULL, '192.168.83.1', '',
        'prod', '', '', '', 'yaml', '');
