INSERT INTO `his_config_info`
VALUES (591, 1904, 'hairoutech-gateway', 'hairoutech-gateway', '',
        '#是否启用鉴权\nauth.enable=true\n#jwt的签名key\nauth.signing-key=defaultSigningKey\n#无需拥有权限即可访问的后端接口\nauth.ignore-url=/user/api/currentUser/searchMenuTree,/user/api/user/info,/user/api/user/nav,/user/oauth/token,/user/doc.html,/user/config.js,/user/api/other/getEnum,/user/kv/getall/,/user/locales/get,/api/system/getEnum,/api/mockAdmin,/api/doc.html,/api/kv/getall,/api/locales/get,/i18n/app/heartbeat,/i18n/kv/detail/query,/i18n/kv/getall,/i18n/locales/get,/i18n/doc.html,/wms/dictionary/getEnum,/wms/doc.html,/i18n/kv/list/query,/wms/kv/getall,/wms/sysConfig/getBackgroundImage,/wms/sysConfig/getValueByCode,/wms/locales/get,/station/kv/getall,/station/locales/get,/station/websocket,/station/doc.html,/station/station/config/stationConfigDetail,/station/station/getStationCode,/station/station/initStation,/station/station/getStationMetadata,/user/external/get,/user/external/logout\n\n#nacos服务发现服务器地址+端口号\nspring.cloud.nacos.discovery.server-addr=nova-nacos:8848\n#nacos登陆用户名\nspring.cloud.nacos.discovery.username=nacos\n#nacos登陆密码\nspring.cloud.nacos.discovery.password=nacos\n#nacos服务注册分组\nspring.cloud.nacos.discovery.group=HAIQ\n#nacos服务注册命名空间\nspring.cloud.nacos.discovery.namespace=nova_prod\n\n#设置websocket最大载荷\nspring.cloud.gateway.httpclient.websocket.max-frame-payload-length=10240000\n\n#设置http header大小，保证大token能顺利传递\nserver.max-http-header-size=1024000',
        'ea60aa9912c2452b5c5fc6efd8a74545', '2023-07-05 01:34:35', '2023-07-05 01:34:36', NULL, '192.168.83.1', 'U',
        'nova_prod');
INSERT INTO `his_config_info`
VALUES (1586, 1905, 'gateway', 'swms', '',
        'spring:\n  cloud:\n    nacos:\n      discovery:\n        server-addr: 192.168.83.128:8848\n        namespace: test\n        username: nacos\n        password: nacos\n        group: swms\n    gateway:\n      httpclient:\n        websocket:\n          max-frame-payload-length: 10240000\n  jackson:\n    date-format: yyyy-MM-dd HH:mm:ss\n    time-zone: Asia/Shanghai\n    default-property-inclusion: NON_NULL\n  servlet:\n    multipart:\n      max-file-size: 20MB\n      max-request-size: 20MB\n  redis:\n    redisson:\n      config: |\n        singleServerConfig:\n          idleConnectionTimeout: 100000\n          connectTimeout: 10000\n          timeout: 3000\n          retryAttempts: 3\n          retryInterval: 1500\n          password: null\n          subscriptionsPerConnection: 5\n          clientName: null\n          address: redis://192.168.83.128:6379\n          subscriptionConnectionMinimumIdleSize: 1\n          subscriptionConnectionPoolSize: 50\n          connectionMinimumIdleSize: 32\n          connectionPoolSize: 64\n          database: 3\n          dnsMonitoringInterval: 5000\n        threads: 0\n        nettyThreads: 0\n        codec:\n          class: \"org.redisson.codec.JsonJacksonCodec\"\n        transportMode: \"NIO\"\n        lockWatchdogTimeout: 10000\nserver:\n  max-http-header-size: 1024000\nlogging:\n  config: classpath:logback-spring.xml\n  max-file-size: 250MB\n  max-history: 168\n  total-size-cap: 50GB\n',
        '323b2fb695905932b9b0741ec24bc61d', '2023-07-05 01:36:33', '2023-07-05 01:36:34', NULL, '192.168.83.1', 'U',
        'test');
